// Initialises the rendering system, setting up fonts etc
void Render::SetupFonts()
{
	font.Default = 0x1D; // MainMenu Font from vgui_spew_fonts 
	font.ESP = Interfaces::g_Surface->FontCreate();
	font.Defuse = Interfaces::g_Surface->FontCreate();
	font.Icon = Interfaces::g_Surface->FontCreate();
	font.Guns = Interfaces::g_Surface->FontCreate();

	Interfaces::g_Surface->SetFontGlyphSet(font.ESP, "Calibri", 15, 100, 0, 0, FONTFLAG_ANTIALIAS | FONTFLAG_DROPSHADOW | FONTFLAG_OUTLINE);
	Interfaces::g_Surface->SetFontGlyphSet(font.Defuse, "Tahoma", 16, 100, 0, 0, FONTFLAG_ANTIALIAS | FONTFLAG_DROPSHADOW | FONTFLAG_OUTLINE);
	Interfaces::g_Surface->SetFontGlyphSet(font.Icon, "astriumwep", 18, 100, 0, 0, FONTFLAG_ANTIALIAS | FONTFLAG_DROPSHADOW | FONTFLAG_OUTLINE);
	Interfaces::g_Surface->SetFontGlyphSet(font.Guns, "Calibri", 13, 100, 0, 0, FONTFLAG_ANTIALIAS | FONTFLAG_DROPSHADOW | FONTFLAG_OUTLINE);
}

RECT Render::GetViewport()
{
	RECT Viewport = { 0, 0, 0, 0 };
	int w, h;
	Interfaces::g_Engine->GetScreenSize(w, h);
	Viewport.right = w; Viewport.bottom = h;
	return Viewport;
}

